package main

import "fmt"
// care for  overflow
func canConstruct(ransomNote string, magazine string) bool {
	maps := make([]int, 26)

	for _, c := range magazine {
		maps[c-'a'  ]++
	}

	for _, c := range ransomNote {
		temp := c - 'a'

		if maps[temp] == 0 {
			return false
		}
		maps[temp]--
	}
	return true
}

func main() {
	fmt.Println(canConstruct("",

		""))
}
